	pystr pystr::title() const {
		pystr ret_value, idx_data;
		pystr cmp = " \n\t\0";
		bool upper = true;
		int len = this->length_;
		for (int idx = 0; idx < len; idx++) {
			idx_data = (*this)[idx];
			if (cmp.in_(idx_data)) {
				upper = true;
			}
			else if (upper == true) {
				idx_data = idx_data.upperChar();
				upper = false;
			}
			else {
				idx_data = idx_data.lowerChar();
			}
			ret_value += idx_data;
		}
		return ret_value;
	}
